import { useParams } from "react-router-dom";
import { useState } from 'react';
import axios from 'axios';

const Message = () => {

    const params = useParams();
    
    const [message, setMessage] = useState(null)

    const getMessage = () => {
        axios.get('/api/id/' + params.id)
        .then(res => {
            setMessage(res)
        }).catch(err => {
            console.log(err)
        })
    }

    getMessage()

    return (
        <>
        
            <h1>{params.id}</h1>
            <p>
                {message}
            </p>
        
        </>
    )

}

export default Message
